                "policy_refunds": "Reasonable attempts will be made to provide the customer with the product as listed and to their satisfaction, however due to the nature of the product, no refunds will be issued once payment has been received.  It is the buyer&#39;s responsibility to read the item description.  ALL  listings are for PDF or JPEG files. *** PRINTING IS ONLY AVAILABLE FOR INVITATIONS AND HOLIDAY CARDS.***  It is the buyer&#39;s responsibility to note that ALL items are printable PDFs and NO PHYSICAL ITEMS WILL BE MAILED.  Mimi&#39;s Dollhouse is not responsible if a buyer does not read the item description fully.  ",
                "policy_additional": "PARTIES FOR TWO OR MORE CHILDREN:\r\nIf you are throwing a party fro more than one child (with the exception of the Mickey and Minnie, Pebbles and Bamm Bamm, and Thing 1 & Thing 2 Packages), you must purchase this listing for EACH ADDITIONAL NAME you are wishing to add: \r\nhttps://www.etsy.com/listing/121767346/add-a-second-child-to-any-invitation-or\r\n\r\nMore than 2 names requires pre-approval (email holly@mimisdollhouse.com with any questions)\r\n• • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • •\r\nDESIGN CHANGES:\r\nPrices listed are for the items as listed.  Alterations not listed are available AT EXTRA COST for some designs.  Please contact me PRIOR to purchase if you are needing alterations.  If you do not contact me PRIOR to purchase, there is no guarantee that your alterations can be made. \r\n\r\nAll party files/packages will be sent EXACTLY as described and shown under each party package listing with only a name and age personalization. ANY other changes or customization will require approval and a fee of $5.00/file within the party package.\r\n\r\nAll party files are in English and cannot be translated into another language.\r\n\r\nPhotos of your child can be included on SOME invitation designs.  Photos cannot be included in ANY OTHER file.  Mimi&#39;s Dollhouse CANNOT Photoshop any photo (including color changes, removing blemishes, adding graphics, etc).  Basic cropping can be done only.\r\n• • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • •\r\nINVITATION SIZES:\r\nInvitations come as either a 5x7 JPEG file or an 8.5x11 PDF (2 per page).  The JPEG file will be sent unless the PDF file is requested.  To have the invitation file changed to either a 4x6 JPEG or 6x7.5 JPEG there is a $5 fee.  Please contact seller PRIOR to purchase to have the fee added to your order.\r\n• • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • •\r\nCOLOR VARIATIONS:\r\nPrinted colors may vary from one computer screen to another, one printer to another and even with different types or brands of paper and ink and also with the choice of printer settings. Mimi&#39;s Dollhouse is not responsible for the resulting color variations. Because there are a vast number of variables involved in printing, THERE WILL BE NO REFUNDS and no design revisions of colors if you do not like the colors when printed. If you would like to see the colors as printed on your computer prior to purchase, please email holly at holly@mimisdollhouse.com for a sample.\r\n• • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • •\r\nPROOFS/ PREVIEWS:\r\nTo help keep our costs low, Mimi&#39;s Dollhouse does NOT offer personalized proofs prior to purchase on existing designs.  Example photos provided in the listings or through email will not be personalized to your party.  A preview may be available for custom designs and design changes at the discretion of Mimi&#39;s Dollhouse.  Please contact the seller for specific questions.\r\n• • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • • •\r\nBUSINESS DAYS:\r\nBusiness Days are Monday through Friday (excluding major holidays).  Mimi&#39;s Dollhouse may respond to inquiries and process orders on weekends, but this is not guaranteed. \r\n*Please note that Mimi&#39;s Dollhouse is located in the Pacific Standard time zone (PST) and most email answering takes place in the evenings*\r\n\r\nAll files/images/product are the copyrighted property of Mimi&#39;s Dollhouse and may not be resold, distributed, copied, or altered in part or whole without written permission from Mimi&#39;s Dollhouse.",
