                "policy_welcome": "Thank-you for stopping by our etsy shop, we hope you find something delightful. . It is our desire to find and create unique treasures to fill our pages.\r\nWe make every attempt to accurately describe with words and photos what you&#39;ll be receiving but  remember, most of what we sell in either vintage or up-cycled from vintage materials which means things are in pre-owned and often well loved condition unless otherwise stated. ",
                "policy_payment": " We currently accept pay-pal,  credit cards via Direct Checkout and Etsy gift cards.\r\nPayments  processed through Pay Pal do not need a PayPal account to be placed, you may pay for your order through PayPal with a major credit card.\r\nHave something else in mind? Run it past us, we&#39;ll listen.",
                "policy_shipping": "WELCOME~\r\nWe are as excited about your order as you are and in most cases will ship within the next few days. To keep fees down we ship first class or standard post with tracking unless otherwise specified. Shipping upgrades are always available upon request.\r\n\r\nOur lovelies are packed with the greatest care  to insure they arrive at their destination safe and sound. What&#39;s New on the Mantel  proudly  uses ONLY recycled packing materials,\r\n\r\nShould something arrive damaged  please photograph the item, save all packing materials including the box and convo us just as soon as possible. We can quickly resolve the issue, which in some cases  may involve  processing  an insurance claim.\r\n\r\nPlease contact us if you fear your package has been lost in transit, every post office is a little different but we&#39;ll be happy to do some research on your behalf.\r\n\r\nIt may turn out we are unable to honor some sales  without requiring extra postage, in which case we&#39;ll  contact you quickly to discuss further payment or gladly refund all of your money.\r\nWe happily refund any excess shipping over $3.00 automatically via paypal or direct checkout.\r\n \r\nWe offer FREE SHIPPING on many items in our shop. This most frequently refers to shipping within the US and FREE with another item Internationally.\r\n\r\n\r\n\r\n",
                "policy_refunds": "We are happy to discuss returns on a case by case basis but for the most part all sales are final. Should we accept a return a 20% restocking fee will be deducted from your refund. Buyers are responsible for return shipping fees in addition to the original shipping charges.\r\n\r\nNo returns will be considered after 30 days",
                "policy_additional": "If you are looking for something in particular, send us a note and let us know what it is. We will keep a list of those who have special requests and  keep an eye out for them when purchasing inventory. ",
