            "title": "Mickey Mouse Clubhouse Inspired Bingo Game Digital Printable Party Supplies Birthday Party Game You Print It",
            "description": "Perfect game for your Mickey party!   \r\n--------------------------------------------------\r\nUnlike some other sets with only a few variations, with this set you get 18 UNIQUE CARDS!   They are designed to print out two cards per 8.5&quot;x11&quot; paper.\r\n--------------------------------------------------\r\nIncludes:\r\n- 18 unique Bingo playing cards\r\n- Calling Cards\r\n- 132 markers\r\n--------------------------------------------------\r\nDIRECTIONS:\r\nPrint out as many game boards as you need (18 unique boards included – keep in mind if you print duplicates, you may have multiple winners)   \r\nPunch out markers with a 1” hole punch\r\nCut out calling cards, shuffle, and begin calling!\r\nFirst person to have 4 in a row horizontally, vertically, or diagonally, WINS!\r\n---------------------------------------------------\r\n**********PLEASE NOTE ********* \r\nAt a party, it is best to have more than one &quot;prize.&quot; While the cards are all unique, it is possible to have simultaneous &quot;BINGO&quot; winners due to the order in which cards are drawn, the fact that there is a &quot;free space&quot;, and the fact that there are more character cards than 24 spaces, so different cards have different character combinations. ***\r\n---------------------------------------------------\r\n It is recommended that  you use cardstock to print on, and set your printer to a “premium paper” setting to achieve the best results.   I test all of my digital printables on my HP OfficeJet inkjet 6500 printer.  Keep in mind that color and print quality may vary based on your equipment.  You should be sure to have the latest version of Adobe Reader (available free online).\r\n--------------------------------------------------\r\n*** I do not own the images and you are not paying for the images.  You are paying me for my time and skill in creating these digital files.  This item is not to be resold.***",
