            "description": "Vintage Phillip Martyn Backgammon Board Game by Whittlecraft  produced around 1974 - 1976.  This is a high quality set, which comes complete with all the pieces and a Backgammon Leaflet written by Phillip Martyn, who was a leading backgammon player at the time and who endorsed this set.  Manufactured by Whittlecraft of Worcester who were the sole manufacturers of the Phillip Martyn Backgammon Sets.  It comprises a board, set within a black leatherette case, two large plastic shakers, four Dice and a larger Numbered Dice, 15 Cream, and 15 Red &#39;Stones&#39; with Medusa&#39;s head on them and  a &#39;How to play Backgammon&#39; leaflet - all are original.\r\n\r\nThe set is in very good condition; some of the gold decoration around the inside of the box has worn away and there is very slight scuffing to the outer box. The box fastens with two brass clasps.\r\n\r\nApproximate Measurements:\r\n\r\nLength  16 inches (40.6cms) x Width 9 3/4 inches (24.7cms)  x Depth 1 3/4 inches (4.4cms)\r\n\r\nThe inclusion of the booklet by Phillip Martyn, makes this a real collector&#39;s piece - or an ideal Christmas present for the experienced player or someone just wanting to learn!\r\n\r\nSee my other Vintage Collectables at:-\r\n\r\nhttps://www.etsy.com/uk/shop/crabtulip?section_id=14478540&ref=shopsection_leftnav_3",
