            "description": "Beautiful Vintage Cribbage Board made by Chas Goodall & Son Ltd. London. Charles Goodall founded his company in Soho in 1820 and became famous for producing high quality playing cards. His two sons joined him in the business and in 1860 they introduced accessories for playing cards such as cribbage boards and whist markers.  \r\n\r\nThe board is mahogany ground with rosewood and satinwood veneers.  Nicely polished there is a chevron pattern down the centre and inlaid cribbage tracks.  There is a pegslide cover underneath containing the original bone pegs; two red and two white.  The label on the back is marked &#39;The Cribbage Board - No.9914 - Chas.Goodall &Son, Ltd.   The board rests on four brass button feet.\r\n\r\nThis rare piece is in excellent condition; there are a couple of light scratches to the base, slight wear on the brass feet and the red pegs have lost some colour - but given its age it looks virtually new!\r\n\r\nApproximate Measurements:-\r\n\r\nLength 10 inches (  ) x Width 3 1/4 x Depth 3/4 inches .\r\n\r\nA fantastic addition to any collection of vintage games and accessories\r\n\r\nSee my other Vintage Collectables at :-\r\n\r\nhttps://www.etsy.com/uk/shop/crabtulip?section_id=14478540&ref=shopsection_leftnav_3",
